function calcDistance(x1, y1, x2, y2) {
  let distance = Math.sqrt(Math.pow(x2 - x1, 2) + Math.pow(y2 - y1, 2));
  return distance;
}

function getClosestImage(vector, images) {
  closest = images[0];
  let distance = calcDistance(vector[0], vector[1], images[0][1], images[0][2]);
  images.forEach((e) => {
    if (calcDistance(vector[0], vector[1], e[1], e[2]) < distance) {
      distance = calcDistance(vector[0], vector[1], e[1], e[2]);
      closest = e;
    }
  });
  document.getElementById("distance").innerHTML = distance;
  document.getElementById("coords").innerHTML = closest[1] + " / " + closest[2];
  return closest[0];
}
